import React from 'react';
import { Link, Route, BrowserRouter as Router, Routes } from 'react-router-dom';
import TP1 from './App';
import TP3 from './ex4';
import TP2 from './profile';

const Entre = () => {
  return (
    <Router>
      <div>
        <nav>
          <button>
            <Link to="/Teste">TP1</Link>
          </button>
          <button>
            <Link to="/tp2">TP2</Link>
          </button>
          <button>
            <Link to="/tp3">TP3</Link>
          </button>
        </nav>

        <hr />
       <Routes>
        <Route path="/tp1" component={TP1} />
        <Route path="/tp2" component={TP2} />
        <Route path="/tp3" component={TP3} />
        </Routes>
      </div>
    </Router>
  );
};

export default Entre;
